                        text.replace(pos, 2, "<b>");
                        pos = text.find("**", pos + 2);
                    }
                    pos = text.find("**");
                    while (pos != std::string::npos) {
                        text.replace(pos, 2, "</b>");
                        pos = text.find("**", pos + 2);
